import React from 'react'
import logo from '../../images/logo.png'
function PageHeader() {

  return (
      <div className='Header'>
        <h1>Myers Park</h1>
         <img src={logo} height='80px'></img>
         <h1>IB Program</h1>
      </div>

  )
}

export default PageHeader
